import React from 'react'
import Spinner1 from '../Spinner/Spinner.gif'
const Spinner = () => {
  return (
    <div>
        <div className="d-flex.justify-content-center align-items-center">
            <img src={Spinner1} alt="" className='img-fluid conatct img'/>
        </div>
    </div>
  )
}

export default Spinner
